import React from "react";
import { useEffect, useState } from "react";

const EncounterPageOne = ({user}) => {

    const [playerChar, setPlayerChar] = useState({})
    const [firstEncounter, setFirstEncounter] = useState({})


    useEffect(() => {
        fetch("/api/char/")
        .then(resp => resp.json())
        .then()
    })

    useEffect(() => {
        fetch("/api/encounters/1")
        .then((resp) => resp.json())
        .then(encounter => setFirstEncounter(encounter))
    },[])



    return (
        <div id="encounter-one">
            <h1>{firstEncounter.encounter_name}</h1>
        </div>
    )

}

export default EncounterPageOne;
